/*eslint-disable*/module.exports={messages:JSON.parse("{\"Book-Now\":\"ßōōķ Ńōŵ\",\"Calendar-select-time\":\"Śēĺēćţ Ţĩmē\",\"Contact.contactUs\":\"Ćōńţàćţ Ũś\",\"Contact.head.meta.description\":\"Ŵàńţ à ƥŕōƒēśśĩōńàĺ ćàŕ ŵàśĥ ƀũţ ďōń'ţ ŵàńţ ţō ĺēàvē ŷōũŕ ĥōũśē? Ćàĺĺ ũś ōŕ àŕŕàńĝē à ƀōōķĩńĝ ńōŵ. Àńŷŵĥēŕē ĩń śōũţĥ àţĥēńś!!\",\"Contact.head.title\":\"Mōƀĩĺē Ĩńďũśţŕĩàĺ Ćĺēàńĩńĝ | Ĺōćàţĩōń Ōƒ ŷōũŕ Ćĥōĩćē\",\"Contact.orBy\":\"Ōŕ Vĩà\",\"Contact.phone\":\"Ƥĥōńē:\",\"Contact.welovetohelp\":\"Ŵē ĺōvē ţō\",\"Contact.welovetohelphelp\":\"ĥēĺƥ\",\"FAQ.answer.1\":\"Ĝĺōŵ Ķĩńĝ ĩś ţĥē śēŕvĩćē ţĥàţ ćōmēś ŵĥēŕēvēŕ ŷōũ àŕē ŵĩţĥ Ĵũśţ ōńē ćĺĩćķ! Ŕēśƥēćţĩńĝ ŷōũŕ ńēēďś àńď ţĩmē, ŷōũ ćàĺĺ ũś ēĩţĥēŕ ƀŷ ƥĥōńē ōŕ ţĥŕōũĝĥ ōũŕ ē-ƀōōķĩńĝ ƥĺàţƒōŕm àńď ŵē ćōmē ŵĥēŕēvēŕ ŷōũ àŕē àţ ţĥē ţĩmē ŷōũ ćĥōōśē àńď ŵĩţĥ ţĥē ŵàśĥĩńĝ śēŕvĩćēś ŷōũ ćĥōōśē. Ƒōŕ ũś, ţĥē ƥŕōţàĝōńĩśţ ĩś ŷōũ!\",\"FAQ.answer.2\":\"Ďĩďń'ţ ƒĩńď ŵĥàţ ŷōũ ńēēď? Ďō ńōţ ĥēśĩţàţē ţō ćōńţàćţ ũś ēĩţĥēŕ ƀŷ ƥĥōńē ōŕ ƀŷ ēmàĩĺ.\",\"FAQ.answer.3\":\"Àţ ţĥē ćōmƥĺēţĩōń ōƒ ōũŕ ŵōŕķ àńď àƒţēŕ ŷōũ ĥàvē ƒĩńĩśĥēď ēvàĺũàţĩńĝ ŷōũŕ ēxƥēŕĩēńćē ōƒ ōũŕ śēŕvĩćēś, ŷōũ ƥàŷ ōũŕ śţàƒƒ ĩń ćàśĥ.\",\"FAQ.answer.4\":\"ĵũśţ ōńē ćĺĩćķ ƒŕōm ŷōũŕ śĩďē! Ĺēàvē ţĥē ŕēśţ ţō ũś.\",\"FAQ.question.1\":\"ĤŌŴ ĎŌĒŚ ĨŢ ŴŌŔĶ?\",\"FAQ.question.2\":\"ŴĤĒŔĒ ŢŌ ÀŚĶ ǪŨĒŚŢĨŌŃŚ?\",\"FAQ.question.3\":\"ĤŌŴ ŶŌŨ ƤÀŶ?\",\"FAQ.question.4\":\"ŴĤÀŢ ĎŌĒŚ ĨŢ ŢÀĶĒ?\",\"Footer.aboutUs\":\"ĜĹŌŴ ĶĨŃĜ ÀŢĤĒŃŚ ĩś àń ĩńńōvàţĩvē ĩďēà ţĥàţ àńńĩĥĩĺàţēś ďĩśţàńćēś! Ĩţ śţàŕţēď ĩń 2019 àńď ĩń ţĥē mĩďďĺē ōƒ ţĥē ƥàńďēmĩć ĩţ ćōvēŕēď àĺĺ ţĥē śōũţĥēŕń śũƀũŕƀś. Ćōmƥĺēţē ćĺēàńĩńĝ śēŕvĩćēś ōƒ ţĥē vēĥĩćĺē, ţĥē ƥŕōƥēŕţŷ, ţĥē ƥàvēmēńţ àńď ēvēŕŷţĥĩńĝ ēĺśē ŷōũ ńēēď! ĜĹŌŴ ĶĨŃĜ ÀŢĤĒŃŚ ōƥēŕàţēś ŵĩţĥ ţĥē ēńvĩŕōńmēńţ àńď ƥēōƥĺē àś ĩţś màĩń ƒōćũś, ńēxţ ţō ŷōũŕ ēvēŕŷ ńēēď. Ĝĺōŵ Ķĩńĝ Àţĥēńś śţàŕŕĩńĝ... ŷōũ!\",\"Footer.contact\":\"Ŵē ćōmē ţō ŵĥēŕē ŷōũ àŕē ŵĩţĥ ōńē ćĺĩćķ!\",\"Footer.help\":\"Ĥēĺƥ\",\"Footer.location\":\"Ŵĥēŕē ţō ƒĩńď ũś\",\"Footer.sitemap\":\"Śĩţēmàƥ\",\"Home.Features\":\"Ƒēàţũŕēś\",\"Home.Services\":\"Ōũŕ Śēŕvĩćēś\",\"Home.feature.four.content\":\"Ĝĺōŵ Ķĩńĝ Àţĥēńś àńď ĩţś śţàƒƒ ŵĩĺĺ ńēvēŕ śĥàŕē ŷōũŕ ƥēŕśōńàĺ ĩńƒōŕmàţĩōń ōŕ vēĥĩćĺē ĩńƒōŕmàţĩōń ŵĩţĥōũţ ŷōũŕ ćōńśēńţ.\",\"Home.feature.four.header\":\"Ƥŕĩvàćŷ Ƒōćũśēď\",\"Home.feature.three.content\":\"Ţĥē ƥŕōďũćţś ũśēď ƒōŕ ćĺēàńĩńĝ àńď ďĩśĩńƒēćţĩōń àŕē ćēŕţĩƒĩēď àńď ƒŕĩēńďĺŷ ţō ĥũmàńś àńď ţĥē ēńvĩŕōńmēńţ, ćōmƥĺŷĩńĝ ŵĩţĥ ēũ śţàńďàŕďś àńď ŕēĝũĺàţĩōńś. Ōũŕ ƥŕōďũćţś àńď màćĥĩńēś àŕē ōƒ ţĥē ũţmōśţ ǫũàĺĩţŷ, ĩńćĺũďĩńĝ ÀŨŢŌĜĹŶM àńď ĶÀŔĆĤĒŔ.\",\"Home.feature.three.header\":\"Śàƒē àńď Ēƒƒēćţĩvē\",\"Home.feature.two.content\":\"Ĩń ƀĩōĺōĝĩćàĺ ćĺēàńĩńĝ, ŵē ŕēmōvē ƒŕōm ţĥē ćàƀĩń àŕēà, śţàĩńś, ƒũńĝĩ, ƀàćţēŕĩà àńď àńŷ ōţĥēŕ ōŕĝàńĩć màţţēŕ. Ŵē ďĩśĩńƒēćţ ţĥē śēàţś, ţĥē śķŷ, ƒĺōōŕś, ĺũĝĝàĝē ćōmƥàŕţmēńţ àńď śĩďē ũƥĥōĺśţēŕŷ. Ŵē àĺśō ďĩśĩńƒēćţ ţĥē àĩŕ ďũćţś ōƒ ţĥē ćàŕ, ŕēmōvĩńĝ ţĥē śţēńćĥ ƒŕōm ţĥē ũśē ōƒ ţĥē àĩŕ ćōńďĩţĩōńēŕ.\",\"Home.feature.two.header\":\"ßĩōĺōĝĩćàĺ Ćĺēàńĩńĝ\",\"Home.featureList.one.content\":\"Ƥŕōƒēśśĩōńàĺ ŵàśĥĩńĝ àńď ćĺēàńĩńĝ ƒōŕ ŷōũŕ ćàŕ!Ţĥē mōƀĩĺē ćàŕ ŵàśĥ ĜĹŌŴ ĶĨŃĜ à mōƀĩĺē ƀũśĩńēśś ţĥàţ ďēàĺś ēxćĺũśĩvēĺŷ ŵĩţĥ ţĥē ćĺēàńĩńĝ àńď ćàŕē ōƒ ćàŕś, ĝĩvēś à ńēŵ ďĩmēńśĩōń ţō ţĥē śƥàćē, ćōmēś ţō ŵĥēŕē ŷōũ àŕē, źēŕōĩńĝ ōũţ ţĥē ďĩśţàńćēś àńď ţàķĩńĝ ćàŕē ōƒ ŷōũŕ ōŵń ćàŕ àś ĩƒ ĩţ ŵēŕē ũńĩǫũē.\",\"Home.featureList.one.header\":\"Ĺōćàţĩōń Ōƒ Ŷōũŕ Ćĥōĩćē\",\"Home.head.title\":\"Ĝĺōŵķĩńĝ | Ćàŕ, ßōàţ, Ĝàŕàĝē, Ƥàvēmēńţ Ćĺēàńĩńĝ Śēŕvĩćēś\",\"Home.serviceSection.content\":\"ĜĹŌŴ ĶĨŃĜ ÀŢĤĒŃŚ ĩś àń ĩńńōvàţĩvē ĩďēà ţĥàţ àńńĩĥĩĺàţēś ďĩśţàńćēś! Ĩţ śţàŕţēď ĩń 2019 àńď ĩń ţĥē mĩďďĺē ōƒ ţĥē ƥàńďēmĩć ĩţ ćōvēŕēď àĺĺ ţĥē śōũţĥēŕń śũƀũŕƀś. Ćōmƥĺēţē ćĺēàńĩńĝ śēŕvĩćēś ōƒ ţĥē vēĥĩćĺē, ţĥē ƥŕōƥēŕţŷ, ţĥē ƥàvēmēńţ àńď ēvēŕŷţĥĩńĝ ēĺśē ŷōũ ńēēď! ĜĹŌŴ ĶĨŃĜ ÀŢĤĒŃŚ ōƥēŕàţēś ŵĩţĥ ţĥē ēńvĩŕōńmēńţ àńď ƥēōƥĺē àś ĩţś màĩń ƒōćũś, ńēxţ ţō ŷōũŕ ēvēŕŷ ńēēď. Ĝĺōŵ Ķĩńĝ Àţĥēńś śţàŕŕĩńĝ... ŷōũ!\",\"Home.serviceSection.title\":\"Ŵĥō Àŕē Ŵē?\",\"Legal.GDPR.header\":\"Ƥŕĩvàćŷ Ƥōĺĩćŷ & Ţēŕmś ōƒ Ũśē\",\"Legal.GDPR.p1\":\"ĜĹŌŴ ĶĨŃĜ ÀŢĤĒŃŚ ũńďēŕśţàńďś ţĥàţ ŷōũŕ ƥŕĩvàćŷ ĩś ĩmƥōŕţàńţ ţō ŷōũ àńď ţĥàţ ŷōũ ćàŕē àƀōũţ ĥōŵ ŷōũŕ ƥēŕśōńàĺ ďàţà ĩś ũśēď àńď śĥàŕēď ōńĺĩńē.\",\"Legal.GDPR.p2\":\"Ŵē ŕēśƥēćţ àńď vàĺũē ţĥē ƥŕĩvàćŷ ōƒ ēvēŕŷōńē ŵĥō vĩśĩţś ţĥĩś ŵēƀśĩţē, àńď ŵē ŵĩĺĺ ōńĺŷ ćōĺĺēćţ àńď ũśē ƥēŕśōńàĺ ďàţà ĩń ŵàŷś ďēśćŕĩƀēď ĥēŕē, àńď ĩń à ŵàŷ ţĥàţ ĩś ćōńśĩśţēńţ ŵĩţĥ ŷōũŕ ōƀĺĩĝàţĩōńś àńď ŕĩĝĥţś ũńďēŕ ţĥē ĺàŵ.\",\"Legal.GDPR.p3\":\"ĜĹŌŴ ĶĨŃĜ ÀŢĤĒŃŚ ćōmƥĺĩēś ŵĩţĥ ţĥē àƥƥĺĩćàƀĺē ĺēĝĩśĺàţĩvē, ŕēĝũĺàţōŕŷ àńď ćōńţŕàćţũàĺ ƥŕōvĩśĩōńś ŕēĝàŕďĩńĝ ţĥē ćōĺĺēćţĩōń, śţōŕàĝē, ŕēćōvēŕŷ àńď ďēśţŕũćţĩōń ōƒ ţĥĩś ďàţà, ĩń ƥàŕţĩćũĺàŕ ŵĩţĥ ţĥē ďĩŕēćţĩvēś ōƒ ţĥē ćōmƥēţēńţ Ŕēĝũĺàţĩōń (ĒŨ) 2016/679 ŵĥĩćĥ ćōńćēŕńś ţĥē ƥŕōţēćţĩōń ōƒ Ƥēŕśōńàĺ Ďàţà (ĜĎƤŔ)\",\"Legal.GDPR.p4\":\"Ƥĺēàśē ŕēàď ţĥĩś Ƥŕĩvàćŷ Ƥōĺĩćŷ ćàŕēƒũĺĺŷ àńď màķē śũŕē ŷōũ ũńďēŕśţàńď ĩţ.\",\"Legal.GDPR.p5\":\"Àććēƥţàńćē ōƒ ţĥē Ƥŕĩvàćŷ Ƥōĺĩćŷ ĩś ďēēmēď ţō ţàķē ƥĺàćē ũƥōń ƒĩŕśţ ũśē ōƒ ţĥē ŵēƀśĩţē.\",\"Legal.GDPR.p6\":\"Ĩƒ ŷōũ ďō ńōţ àććēƥţ àńď àĝŕēē ţō ţĥĩś Ƥŕĩvàćŷ Ƥōĺĩćŷ, ŷōũ mũśţ śţōƥ ũśĩńĝ ōũŕ Ŵēƀśĩţē ĩmmēďĩàţēĺŷ.\",\"Legal.GDPR.p7\":\"Η παρούσα Πολιτική ισχύει για τη χρήση οποιουδήποτε και όλων των Δεδομένων που συλλέγονται από εμάς σε σχέση με τη χρήση της Ιστοσελίδας από εσάς και οποιωνδήποτε Υπηρεσιών ή Συστημάτων σε αυτήν.\",\"Portfolio.head.title\":\"Śōũţĥ Àţĥēńś ćàŕ ćĺēàńĩńĝ śēŕvĩćēś àţ ŷōũŕ ďōōŕ\",\"Portfolio.header\":\"Ōũŕ Ƥōŕţƒōĺĩō\",\"Services-simple-list.five.content\":\"ßĩōćĺēàńĩńĝ śōƒà ĩś ţĥē mōśţ ćōmƥĺēţē śōƒà ćĺēàńĩńĝ ƥŕōćēśś àńď mōŕē ĝēńēŕàĺĺŷ ƒàƀŕĩć śũŕƒàćēś ţĥàţ ŷōũ ćàń ƒĩńď. Ţĥĩś mēţĥōď ćōńćēŕńś ţĥē ƀēśţ ŵàŷ ţō ćĺēàń à ƒàƀŕĩć śũŕƒàćē śĩńćē ĩţ ćĺēàńś śţàĩńś ŕēƒŕēśĥēś ćōĺōŕś, ďĩśĩńƒēćţś ţĥē ēńţĩŕē śũŕƒàćē àńď ďēōďōŕĩźēś ţĥē ũńƥĺēàśàńţ ōńēś śmēĺĺś. Ţĥē śũŕƒàćēś àŕē ţĥēń ƒŕēśĥ ƒōŕ à ƒēŵ ĥōũŕś.\",\"Services-simple-list.five.header\":\"Ĥōmē Śēŕvĩćēś\",\"Services-simple-list.four.content\":\"Ŷōũŕ ƀōàţ ĥàś ƒōũńď ĩţś màśţēŕ! Ōũŕ ćōmƥàńŷ ũńďēŕţàķēś ƀōţĥ ţĥē ĩńţēŕĩōŕ àńď ēxţēŕĩōŕ ćĺēàńĩńĝ ōƒ ŷōũŕ ƀōàţ. Ōũŕ ţŕũśţēď śţàƒƒ ćōmƀĩńēď ŵĩţĥ ţĥē ţōƥ ǫũàĺĩţŷ ōƒ ōũŕ ƥŕōďũćţś ŵĩĺĺ màķē ŷōũŕ ƀōàţ śĥĩńē!\",\"Services-simple-list.four.header\":\"Ŷàćĥţ Śēŕvĩćēś\",\"Services-simple-list.one.content\":\"Ēxţēŕńàĺ ćĺēàńĩńĝ ĩś ďōńē ŵĩţĥōũţ ţĥē ũśē ōƒ à ƀŕũśĥ ōŕ śƥōńĝē, ƀũţ ōńĺŷ ŵĩţĥ ţĥē ũśē ōƒ ĥōţ ŵàţēŕ ƒōŕ ĺēśś ďàmàĝē ţō ţĥē ćàŕ'ś ēxţēŕĩōŕ ƥàĩńţ.Àţ Ĝĺōŵ Ķĩńĝ ŵē ōƒƒēŕ ŷōũ à ćōmƥĺēţē ēxţēŕĩōŕ ćĺēàńĩńĝ ŵĩţĥ ƥŕē-ŵàśĥĩńĝ àńď màĩńĺŷ ŵàśĥĩńĝ ţĥē vēĥĩćĺē ŵĩţĥ àćţĩvē ƒōàm, ćĺēàńĩńĝ ţĥē ďōmēś àńď ŕĩmś, ŕēmōvĩńĝ ĩńśēćţś, ƥŕōţēćţĩvē ŵàx àńď ŕĩńśĩńĝ ţĥē ćàŕ ŵĩţĥ ďēĩōńĩźēď ŵàţēŕ!Ţĥē vēĥĩćĺē ĩś ţĥēń ţĥōŕōũĝĥĺŷ ŵĩƥēď.\",\"Services-simple-list.one.header\":\"Ēxţēŕńàĺ Ŵàśĥ\",\"Services-simple-list.six.content\":\"À ĝàŕàĝē ƒũĺĺ ōƒ ďũśţ, mũď àńď ćĺũţţēŕ? Ōũŕ ćōmƥàńŷ ũńďēŕţàķēś à ćōmƥĺēţē ćĺēàńĩńĝ ōƒ ŷōũŕ ĝàŕàĝē. Ōũŕ ţŕũśţēď śţàƒƒ ćōmƀĩńēď ŵĩţĥ ţĥē ţōƥ ǫũàĺĩţŷ ōƒ ōũŕ ƥŕōďũćţś ŵĩĺĺ màķē ŷōũŕ ĝàŕàĝē śĥĩńē!\",\"Services-simple-list.six.header\":\"Ƥŕōƥēŕţŷ Śēŕvĩćēś\",\"Services-simple-list.three.content\":\"Ćàŕ ďēţàĩĺĩńĝ ĩś ţĥē śēŕvĩćē ţĥàţ ōƒƒēŕś ŷōũ ţĥē ďēţàĩĺĩńĝ ŷōũ ďēśēŕvē! Ţōƥ ǫũàĺĩţŷ màţēŕĩàĺś àńď ţōƥ śţàƒƒ àŕē ţĥē ũĺţĩmàţē ćōmƀĩńàţĩōń ƒōŕ ţōƥ ŕēśũĺţś. À ŕēśũĺţ ŵĩţĥ à ƥŕōţàĝōńĩśţ...ŷōũ!\",\"Services-simple-list.three.header\":\"Ƒũĺĺ Ďēţàĩĺĩńĝ\",\"Services-simple-list.two.content\":\"Ĩń ĩńţēŕńàĺ ćĺēàńĩńĝ, ŵĩţĥ ŕēśƥēćţ ƒōŕ ƥēōƥĺē àńď ţĥē ēńvĩŕōńmēńţ àś ōũŕ ĝũĩďĩńĝ ƥŕĩńćĩƥĺē, ŵē ũśē ēćōĺōĝĩćàĺĺŷ ƀĩōďēĝŕàďàƀĺē ƥŕōďũćţś.Ĩńţēŕńàĺĺŷ ŵē ƀĺōŵ ţĥē vēĥĩćĺē ţō ŕēmōvē ţĥē ďũśţ àńď ţĥēń vàćũũm ţĥē ćàƀĩń àńď ţĥē ĺũĝĝàĝē ćōmƥàŕţmēńţ, ćĺēàńĩńĝ ţĥē ŵĩńďōŵś àńď àĺĺ ĝĺàśś śũŕƒàćēś.Ƒĩńàĺĺŷ, ŵē ƥŕōćēēď ŵĩţĥ ćĺēàńĩńĝ àńď màĩńţēńàńćē ōƒ àĺĺ ĺēàţĥēŕ àńď ƥĺàśţĩć śũŕƒàćēś, ďŕŷ ćĺēàńĩńĝ ōƒ ćàŕƥēţś àńď ƥēŕƒũmĩńĝ ţĥē ćàƀĩń àŕēà.\",\"Services-simple-list.two.header\":\"Ĩńţēŕńàĺ Ćĺēàńĩńĝ\",\"bookingForm.MinimumOvertimeCharge\":\"Ŵē ĥàvē ţō mēńţĩōń ţĥàţ ŵē ćĥàŕĝē 30€ ƒōŕ ţĥē ƒĩŕśţ ĥōũŕ àńď à ĥàĺƒ ōƒ ćĺēàńĩńĝ. Ēvēŕŷ àďĩţĩōńàĺ ĥōũŕ àƒţēŕ ţĥàţ ĩś àńōţĥēŕ 30 ēũŕō. Ƥĺēàśē àććēƥţ ĩƒ ŷōũ àĝŕēē.\",\"bookingForm.input.accept\":\"Àććēƥţ Ţēŕmś àńď \",\"bookingForm.input.conditions\":\"Ćōńďĩţĩōńś\",\"bookingForm.input.email\":\"Ēmàĩĺ\",\"bookingForm.input.location\":\"Ĺōćàţĩōń\",\"bookingForm.input.message\":\"Śƥēćĩàĺ Ĩńśţŕũćţĩōńś\",\"bookingForm.input.name\":\"Ƒũĺĺ Ńàmē\",\"bookingForm.input.number\":\"Ƥĥōńē Ńũmƀēŕ\",\"car-service-extras.1.content\":\"Ŵàśĥĩńĝ ţĥē ƀōţţōm ōƒ ţĥē ćàŕ, ŕēmōvēś mũď, śàĺţś (ƒŕōm ţĥē ŵĩńţēŕ śēàśōń) àńď ďĩŕţ ţĥàţ ĥàś àććũmũĺàţēď ōvēŕ ţĩmē.\",\"car-service-extras.1.title\":\"ŴÀŚĤÀßĹĒ ƑŔŌM ßĒĹŌŴ\",\"detail-car-wash.car-cleaning.p-1.2\":\"Ţĥē ēxţēŕńàĺ ćĺēàńĩńĝ ĩś ďōńē ŵĩţĥōũţ ţĥē ũśē ōƒ à ƀŕũśĥ ōŕ śƥōńĝē ƀũţ ōńĺŷ ŵĩţĥ ţĥē ũśē ōƒ ĥōţ ŵàţēŕ ƒōŕ ĺēśś ďàmàĝē ţō ţĥē ćàŕ'ś ēxţēŕĩōŕ ƥàĩńţ.\",\"detail-car-wash.car-cleaning.p-1.3\":\"Àţ Ĝĺōŵ Ķĩńĝ ŵē ōƒƒēŕ ŷōũ à ćōmƥĺēţē ēxţēŕĩōŕ ćĺēàńĩńĝ ŵĩţĥ ƥŕē-ŵàśĥĩńĝ àńď màĩńĺŷ ŵàśĥĩńĝ ţĥē vēĥĩćĺē ŵĩţĥ àćţĩvē ƒōàm, ćĺēàńĩńĝ ţĥē ƒōĝ ĺĩĝĥţś àńď ŕĩmś, ŕēmōvĩńĝ ĩńśēćţś, ƥŕōţēćţĩvē ŵàx àńď ŕĩńśĩńĝ ţĥē ćàŕ ŵĩţĥ ďēĩōńĩźēď ŵàţēŕ!\",\"detail-car-wash.car-cleaning.p-1.4\":\"Ţĥē vēĥĩćĺē ĩś ţĥēń ţĥōŕōũĝĥĺŷ ŵĩƥēď.\",\"detail-car-wash.car-cleaning.p-1.5\":\"Ĩń ĩńţēŕńàĺ ćĺēàńĩńĝ, ŵĩţĥ ŕēśƥēćţ ƒōŕ ƥēōƥĺē àńď ţĥē ēńvĩŕōńmēńţ àś ōũŕ ĝũĩďĩńĝ ƥŕĩńćĩƥĺē, ŵē ũśē ēćōĺōĝĩćàĺĺŷ ƀĩōďēĝŕàďàƀĺē ƥŕōďũćţś.\",\"detail-car-wash.car-cleaning.p-1.6\":\"Ĩńţēŕńàĺĺŷ ŵē ƀĺōŵ ţĥē vēĥĩćĺē ţō ŕēmōvē ţĥē ďũśţ àńď ţĥēń vàćũũm ţĥē ćàƀĩń àńď ţĥē ĺũĝĝàĝē ćōmƥàŕţmēńţ, ćĺēàńĩńĝ ţĥē ŵĩńďōŵś àńď àĺĺ ĝĺàśś śũŕƒàćēś.\",\"detail-car-wash.car-cleaning.p-1.7\":\"Ƒĩńàĺĺŷ, ŵē ƥŕōćēēď ŵĩţĥ ćĺēàńĩńĝ àńď màĩńţēńàńćē ōƒ àĺĺ ĺēàţĥēŕ àńď ƥĺàśţĩć śũŕƒàćēś, ďŕŷ ćĺēàńĩńĝ ōƒ ćàŕƥēţś àńď ƥēŕƒũmĩńĝ ţĥē ćàƀĩń àŕēà.\",\"detail-car-wash.car-cleaning.p-1.title\":\"Ēxţēŕńàĺ + Ĩńţēŕńàĺ Ćĺēàńĩńĝ\",\"detail-car-wash.car-cleaning.p-2.1\":\"Ĩń ƀĩōĺōĝĩćàĺ ćĺēàńĩńĝ, ŵē ŕēmōvē ƒŕōm ţĥē ćàƀĩń àŕēà, àƥàŕţ ƒŕōm śţàĩńś, ŵē ćĺēàń ƒũńĝĩ, ƀàćţēŕĩà àńď àńŷţĥĩńĝ ţĥàţ ƀũŕďēńś ţĥē ĥũmàń ƀōďŷ.\",\"detail-car-wash.car-cleaning.p-2.2\":\"Ŵē ďĩśĩńƒēćţ ţĥē śēàţś, ţĥē śķŷ, ƒĺōōŕś, ĺũĝĝàĝē ćōmƥàŕţmēńţ àńď śĩďē ũƥĥōĺśţēŕŷ.\",\"detail-car-wash.car-cleaning.p-2.3\":\"Ŵē àĺśō ćōmƥũĺśōŕĩĺŷ ďĩśĩńƒēćţ ţĥē àĩŕ ďũćţś ōƒ ţĥē ćàŕ, ŕēmōvĩńĝ ţĥē śţēńćĥ ƒŕōm ţĥē ũśē ōƒ ţĥē àĩŕ ćōńďĩţĩōńēŕ.\",\"detail-car-wash.car-cleaning.p-2.4\":\"Ţĥē ƥŕōďũćţś ũśēď ƒōŕ ćĺēàńĩńĝ àńď ďĩśĩńƒēćţĩōń àŕē ćēŕţĩƒĩēď àńď ƒŕĩēńďĺŷ ţō ĥũmàńś àńď ţĥē ēńvĩŕōńmēńţ, ćōmƥĺŷĩńĝ ŵĩţĥ ĒŨ śţàńďàŕďś.\",\"detail-car-wash.car-cleaning.p-2.5\":\"Ŵē àĺśō ōƒƒēŕ à ĺàŕĝē ĺĩśţ ōƒ àďĩţĩōńàĺ ōƥţĩōńàĺ ćĺēàńĩńĝ śēŕvĩćēś ƒōŕ ŷōũŕ ćàŕ\",\"detail-car-wash.car-cleaning.p-2.title\":\"Ōŕĝàńĩć Màţţēŕ Ćĺēàńĩńĝ\",\"detail-car-wash.car-cleaning.title\":\"Ćàŕ Śēŕvĩćēś\",\"detail-car-wash.detailing.p-1.1.content\":\"Ţĥē śũśƥēńśĩōń ĩś ţĥē śŷśţēm ţĥàţ ŕēĝũĺàţēś ţĥē ćōńţàćţ àńď ĝŕĩƥ ōƒ ţĥē ćàŕ ţĥŕōũĝĥ ţĥē ţĩŕēś àńď śĥōćķ àƀśōŕƀēŕś ŵĩţĥ ţĥē ŕōàď śũŕƒàćē àńď ĩś ōńē ōƒ ţĥē ƀàśĩć śŷśţēmś ţĥàţ ţĥē ćàŕ ĥàś ƒōŕ ōũŕ śàƒē àńď śţàƀĺē mōvēmēńţ. Śĥōćķ àƀśōŕƀēŕś àńď śƥŕĩńĝś àŕē ţĥē màĩń ćōmƥōńēńţś ōƒ ţĥē śũśƥēńśĩōń śŷśţēm, ţĥēŷ àŕē ŕēśƥōńśĩƀĺē ƒōŕ àďĴũśţĩńĝ àńď àƀśōŕƀĩńĝ ţĥē śĥōćķś ţĥàţ ćōńţŕĩƀũţē ţō ţĥē \\\"ĥōĺď\\\" ōƒ ţĥē ćàŕ. Ţĩmēĺŷ ćĺēàńĩńĝ ōƒ ţĥē śĥōćķ àƀśōŕƀēŕ ĩś ĩmƥēŕàţĩvē ƒōŕ ţĥē śàƒēţŷ ōƒ ţĥē ćàŕ.\",\"detail-car-wash.detailing.p-1.2.content\":\"Ōĩĺ àńď Śƥŕàŷ ōƒ ēxćēĺĺēńţ ǫũàĺĩţŷ àŕē ţĥē śēćŕēţ ţō ƥŕōƥēŕĺŷ ćĺēàńĩńĝ ŷōũŕ ďĩść. Ƒŕōńţ àńď ŕēàŕ ďĩśćś àŕē ōńē ōƒ ţĥē mōśţ ĩmƥōŕţàńţ ƥàŕţś ōƒ ŷōũŕ vēĥĩćĺē, àńď ƒōŕ ţĥàţ ŕēàśōń àĺōńē, ŷōũ ďēśēŕvē ōńĺŷ ţĥē ƀēśţ. Ōũŕ ēxƥēŕĩēńćēď śţàƒƒ, ōũŕ ēxćēĺĺēńţ màţēŕĩàĺś, ōũŕ śƥēćĩàĺĩźēď śţàƒƒ àŕē ţĥē àńśŵēŕ ţō ŷōũŕ ǫũēśţĩōńś àńď ţĥē śōĺũţĩōń ţō ŷōũŕ ƥŕōƀĺēmś.\",\"detail-car-wash.detailing.p-1.title\":\"Śĥōćķ àƀśōŕƀēŕ + Ŵĥēēĺ àŕćĥ + Ďĩść ćĺēàńĩńĝ\",\"detail-car-wash.detailing.p-2.1.content\":\"Àĺũmĩńũm ŵĥēēĺś ōń à ćàŕ àŕē àmōńĝ ţĥē ƥĺàćēś ţĥàţ ĝēţ ďĩŕţŷ vēŕŷ ǫũĩćķĺŷ. Śàńď, mũď, ďũśţ àńď àńŷţĥĩńĝ ēĺśē ţĥàţ màŷ ƀē ōń ţĥē ŕōàď śũŕƒàćē ŵĩĺĺ śţĩćķ ţō àńď śţàĩń ţĥē ţĩŕē ŕĩm. Ŵĩţĥōũţ śŷśţēmàţĩć ćĺēàńĩńĝ, ĩń ƒàćţ, ţĥēśē ĩmƥũŕĩţĩēś ćàń ĺēàď ţō ţĥē ďēśţŕũćţĩōń ōƒ ţĥē àĺũmĩńũm. Ƒōŕ ţĥĩś ŕēàśōń, ćĺēàńĩńĝ ţĥē ŕĩmś àţ ĺēàśţ 1-2 ţĩmēś à mōńţĥ ĩś ĩmƥēŕàţĩvē àńď ŵē ćàń ďō ĩţ ƒōŕ ŷōũ. Ĺēàŕń ĥōŵ!\",\"detail-car-wash.detailing.p-2.title\":\"Ŕĩmś\",\"detail-car-wash.detailing.p-3.1.content\":\"Ŵē àĺśō ĥàvē śƥēćĩàĺĩźēď śţàƒƒ àńď śƥēćĩàĺĩźēď màćĥĩńēŕŷ ţō ƀē àƀĺē ţō ƥōĺĩśĥ ĩń ďēţàĩĺ ēvēŕŷ ƥōĩńţ ĩńàććēśśĩƀĺē ƀŷ ţĥē ĥũmàń ĥàńď, ēvēŕŷ ďĩƒƒĩćũĺţŷ ƒōŕ ŷōũ...à ćĥàĺĺēńĝē ƒōŕ ũś!\",\"detail-car-wash.detailing.p-3.title\":\"Ƥōĺĩśĥĩńĝ ĩń ƥĺàćēś ĩńàććēśśĩƀĺē ƀŷ ţĥē ĥũmàń ĥàńď\",\"detail-car-wash.detailing.p-4.1.content\":\"Ńàńōţēćĥńōĺōĝŷ ĩś à śćĩēńćē ţĥàţ ĥàś ţĥē àƀĩĺĩţŷ ţō ćōńţŕōĺ ţĥē ďĩmēńśĩōńś ōƒ màţēŕĩàĺś àţ ţĥē ńàńōmēţēŕ śćàĺē àńď ĥàś ďēmōńśţŕàţēď ţĥē ĩmƥŕēśśĩvē ƥŕōƥēŕţĩēś ţĥēŷ àćǫũĩŕē ŵĥēń ţĥēĩŕ ďĩmēńśĩōńś àŕē ōńĺŷ à ƒēŵ ńàńōmēţēŕś.\",\"detail-car-wash.detailing.p-4.2.content\":\"Ţĥē ĩńţēŕēśţ ōƒ śćĩēńćē ĥàś ţũŕńēď ţō ńàńōţēćĥńōĺōĝŷ màţēŕĩàĺś. Ţĥŕōũĝĥ ŕēśēàŕćĥ, ţĥēŷ ƒōũńď ţĥàţ ţĥē ƥàŕţĩćĺēś ōƒ śũćĥ màţēŕĩàĺś ĥàvē vēŕŷ ďĩƒƒēŕēńţ ƥŕōƥēŕţĩēś ďũŕĩńĝ ţĥēĩŕ ƒōŕmàţĩōń ćōmƥàŕēď ţō ţĥē ĺàŕĝē ƥàŕţĩćĺēś ţĥàţ àŕē vĩśĩƀĺē ţō ţĥē ńàķēď ēŷē ōŕ ŵĩţĥ à śĩmƥĺē ōƥţĩćàĺ mĩćŕōśćōƥē.\",\"detail-car-wash.detailing.p-4.3.content\":\"Ńàńōţēćĥńōĺōĝŷ ƥŕōďũćţś àŕē śƥēćĩàĺĺŷ ďēśĩĝńēď ţō ōƒƒēŕ ƥŕōţēćţĩōń ţō ŷōũŕ ƒàvōŕĩţē ƒàƀŕĩćś, ŵōōďēń śũŕƒàćēś, ĝĺàśś, ƥĺàśţĩć ĩţēmś ōŕ śţàĩńĺēśś śţēēĺ, ēvēń ŷōũŕ ƒĺōōŕś, ţĩĺēś, ćàŕ ŕĩmś.\",\"detail-car-wash.detailing.p-4.4.content\":\"Ēvēŕŷţĥĩńĝ ĩś ƥŕōţēćţēď ƒŕōm śţàĩńś, ƀàćţēŕĩà, ŵàţēŕ, mōĩśţũŕē àńď ēvēŕŷţĥĩńĝ śţàŷś ĩńţàćţ ƒōŕ à mũćĥ ĺōńĝēŕ ţĩmē. Àƀśōĺũţē ƥŕōţēćţĩōń ĩś àćĥĩēvēď ƀŷ àvōĩďĩńĝ ţĥē ũśē ōƒ ĥàŕmƒũĺ ćĥēmĩćàĺś.\",\"detail-car-wash.detailing.p-4.title\":\"Ńàńōţēćĥńōĺōĝŷ\",\"detail-car-wash.detailing.p-5.1.content\":\"Àńōţĥēŕ ƥōĩńţ ţĥàţ ŵē ŵĩĺĺ ōƒţēń ĥàvē ţō màĩńţàĩń ĩś ţĥē ƀōţţōm ōƒ ţĥē ćàŕ, ēśƥēćĩàĺĺŷ ƒōŕ ćàŕś ţĥàţ àŕē ēxƥōśēď ţō śēà ōŕ śńōŵ. Ţĥē ĺōŵēŕ ƥàŕţ ōƒ ţĥē ćàŕ ĩś ŵàśĥēď àƒţēŕ ũśĩńĝ ţĥē śƥēćĩàĺ ćĥàśśĩś ŵàśĥĩńĝ màćĥĩńē. Ţĥēń ŵē śƥŕàŷ ţĥē ćĺēàńēŕ àńď ŕĩńśē ţĥōŕōũĝĥĺŷ ţō ćĺēàń ēvēŕŷŵĥēŕē ĩńśĩďē ţĥē ŵĥēēĺś àńď àĺĺ ţĥē mēćĥàńĩćàĺ ƥàŕţś ţĥàţ àŕē ēxƥōśēď ũńďēŕńēàţĥ.\",\"detail-car-wash.detailing.p-5.title\":\"Ũńďēŕƀōďŷ ŵàśĥĩńĝ / Ćĥàśśĩś\",\"detail-car-wash.detailing.title\":\"Ďēţàĩĺĩńĝ Ĩńƒōŕmàţĩōń\",\"detail-car-wash.motorbike.p-1.1\":\"Ţĥē ćĺēàńĩńĝ ĩś ďōńē ŵĩţĥōũţ ţĥē ũśē ōƒ à ƀŕũśĥ ōŕ śƥōńĝē ƀũţ ōńĺŷ ŵĩţĥ ţĥē ũśē ōƒ ĥōţ ŵàţēŕ ƒōŕ ĺēśś ďàmàĝē ţō ţĥē ćàŕ'ś ēxţēŕĩōŕ ƥàĩńţ.\",\"detail-car-wash.motorbike.p-1.2\":\"Àţ Ĝĺōŵ Ķĩńĝ ŵē ōƒƒēŕ ŷōũ à ćōmƥĺēţē ćĺēàńĩńĝ ŵĩţĥ ƥŕē-ŵàśĥĩńĝ àńď màĩńĺŷ ŵàśĥĩńĝ ţĥē màćĥĩńē ŵĩţĥ àćţĩvē ƒōàm, ćĺēàńĩńĝ ţĥē ƒōĝ ĺĩĝĥţś àńď ŕĩmś, ŕēmōvĩńĝ ĩńśēćţś, ƥŕōţēćţĩvē ŵàx àńď ŕĩńśĩńĝ ţĥē ćàŕ ŵĩţĥ ďēĩōńĩźēď ŵàţēŕ!\",\"detail-car-wash.motorbike.p-1.3\":\"Ŷōũŕ màćĥĩńē ĩś ţĥēń ţĥōŕōũĝĥĺŷ ŵĩƥēď.\",\"detail-car-wash.motorbike.p-1.4\":\"Ĩń ćĺēàńĩńĝ, ŵĩţĥ ŕēśƥēćţ ƒōŕ ƥēōƥĺē àńď ţĥē ēńvĩŕōńmēńţ àś ōũŕ ĝũĩďĩńĝ ƥŕĩńćĩƥĺē, ŵē ũśē ēćōĺōĝĩćàĺĺŷ ƀĩōďēĝŕàďàƀĺē ƥŕōďũćţś.\",\"detail-car-wash.motorbike.p-1.5\":\"Ŵē ƀĺōŵ ţĥē ĩńśĩďē ōƒ ŷōũŕ màćĥĩńē ţō ŕēmōvē ţĥē ďũśţ àńď ţĥēń ćĺēàń ŵĩţĥ à vàćũũm ćĺēàńēŕ. Ƒĩńàĺĺŷ, ŵē ƥŕōćēēď ŵĩţĥ ćĺēàńĩńĝ àńď màĩńţēńàńćē ōƒ àĺĺ ƥĺàśţĩć śũŕƒàćēś, ďŕŷ ćĺēàńĩńĝ àńď ƥēŕƒũmĩńĝ ţĥē śàďďĺē ōƒ ŷōũŕ màćĥĩńē.\",\"detail-car-wash.motorbike.p-1.6\":\"Mĩńĩmũm ćĥàŕĝē ţō ćōmē ţō ŷōũŕ ƥĺàćē: €30.00\",\"detail-car-wash.motorbike.title\":\"Mōţōŕƀĩķē Ćĺēàńĩńĝ\",\"detail-car-wash.title\":\"Ćàŕ Ćĺēàńĩńĝ àńď Ďēţàĩĺĩńĝ Śēŕvĩćēś\",\"detailing-car-wash.list-1.content\":\"Ƥēŕƒēćţĺŷ ďēţàĩĺēď, ţĥē ƥàĩńţ ōń ŷōũŕ vēĥĩćĺē ďŕàŵś ţĥē mōśţ àţţēńţĩōń. Ƥŕĩmàŕĩĺŷ, ţĥē ēxţēŕĩōŕ ĩś ƥŕēśśũŕē ŵàśĥēď ţō ŕēmōvē ďĩŕţ àńď ţĥēń ĥàńď ďŕĩēď. Ƒĩńàĺĺŷ, à ĥàńď ōŕ màćĥĩńē ƥōĺĩśĥ ĝĩvēś ţĥē śũŕƒàćē àń ēvēń śĥĩńē àńď ŕēmōvēś ƒĩńē śćŕàţćĥēś ţō ĝĩvē ţĥē ŕēśũĺţ ŷōũ ďēśēŕvē.\",\"detailing-car-wash.list-1.title\":\"Ēxţēŕĩōŕ ƥàĩńţ ćàŕē àńď ƥōĺĩśĥĩńĝ\",\"detailing-car-wash.list-2.content\":\"Ēxţēŕĩōŕ śũŕƒàćēś àńď ƒĩńĩśĥēś śũćĥ àś ƥĺàśţĩć, ŕũƀƀēŕ àńď ćĥŕōmē ćàń ƒàďē àńď ćŕàćķ ŵĩţĥōũţ ƥŕōƥēŕ ćàŕē ōŕ ũńďēŕ ōţĥēŕ àďvēŕśē ćōńďĩţĩōńś. Ďũŕĩńĝ à ƒũĺĺ ďēţàĩĺĩńĝ, ţĥē ēxţēŕĩōŕ śũŕƒàćēś àŕē ćĺēàńēď àńď ţĥēń ƥŕōţēćţēď. À ƥĺàśţĩć śēàĺēŕ ćàń ƀē àƥƥĺĩēď ţō ŕũƀƀēŕ ōŕ vĩńŷĺ àńď ţĥē ćĥŕōmē ţōńēś ŵĩĺĺ ƀē ƥōĺĩśĥēď.\",\"detailing-car-wash.list-2.title\":\"ĆĹĒÀŃĨŃĜ ÀŃĎ ƤŌĹĨŚĤĨŃĜ ŌƑ ĒXŢĒŔŃÀĹ ŚŨŔƑÀĆĒŚ\",\"detailing-car-wash.list-3.content\":\"ßŕàķē ďũśţ, ďĩŕţ àńď ĝŕĩmē ƒŕōm ţĥē ŕōàď ćōĺĺēćţś ōń ŷōũŕ ŵĥēēĺś àńď, ōvēŕ ţĩmē, ţĥēśē ƀĺēmĩśĥēś ƀēćōmē ďĩƒƒĩćũĺţ ţō ŕēmōvē. À ƒũĺĺ śēŕvĩćē ďēţàĩĺ ŵĩĺĺ ćōmƥĺēţēĺŷ ŕēśţōŕē ŷōũŕ vēĥĩćĺē'ś ŵĥēēĺś, ŕēmōvē ţĥōśē śţũƀƀōŕń śţàĩńś àńď ƥōĺĩśĥ ţĥē ćĥŕōmē, śţēēĺ ōŕ àĺũmĩńũm. Ţĥē ţĩŕēś ŵĩĺĺ àĺśō ƀē ƥŕōţēćţēď ŵĩţĥ ŕũƀƀēŕ śēàĺàńţ, ŵĥĩćĥ ĝĩvēś ţĥēm à ĝĺōśśŷ ƒĩńĩśĥ.\",\"detailing-car-wash.list-3.title\":\"ŴĤĒĒĹŚ ÀŃĎ ŢĨŔĒŚ ĎĒŢÀĨĹŚ\",\"detailing-car-wash.list-4.content\":\"Ēvēŕŷ ćōŕńēŕ ōƒ ŷōũŕ vēĥĩćĺē'ś ĩńţēŕĩōŕ ţēńďś ţō ćōĺĺēćţ ďũśţ àńď ďĩŕţ. Ţĥē ŕēţàĩĺēŕ'ś Ĵōƀ ĩś ţō ŕēmōvē ďĩŕţ àńď ďũśţ ƒŕōm ĥàŕď-ţō-ŕēàćĥ ćŕàćķś àńď ćŕēvĩćēś. Ţĥĩś śēŕvĩćē ĩńćĺũďēś àĺĺ śũŕƒàćēś ĩńćĺũďĩńĝ ţĥē ďàśĥƀōàŕď, ēńţēŕţàĩńmēńţ ćōńśōĺē, ĩńśĩďē ďōōŕś, ũńďēŕ ţĥē śēàţś àńď àńŷ ōţĥēŕ ĩńţēŕĩōŕ śũŕƒàćē. Ōńćē ţĥē ďĩŕţ ĩś ŕēmōvēď, śēàĺàńţś àŕē àƥƥĺĩēď, ŵĥĩćĥ ĝĩvē ţĥēśē śũŕƒàćēś à ĥĩĝĥ-ǫũàĺĩţŷ śĥĩńē.\",\"detailing-car-wash.list-4.title\":\"ßĨŌĹŌĜĨĆÀĹ ĆĹĒÀŃĨŃĜ ĨŃ ŢĤĒ ĨŃŢĒŔĨŌŔ ŌƑ ŢĤĒ ĆÀŔ\",\"detailing-car-wash.list-5.content\":\"Ĺēàţĥēŕ ŕēǫũĩŕēś śƥēćĩàĺ ƥŕēƥàŕàţĩōń àńď ĥàńďĺĩńĝ ŵĥēń ćĺēàńĩńĝ. Śōmē ţŕàďĩţĩōńàĺ ćàŕ ćĺēàńĩńĝ ƥŕōďũćţś àŕē vēŕŷ ćàũśţĩć ţō ţĥē śķĩń àńď màŷ ēvēń ďō mōŕē ĥàŕm ţĥàń ĝōōď. Ďũŕĩńĝ àń ĩńţēŕĩōŕ ďēţàĩĺ, àńŷ ĺēàţĥēŕ śũŕƒàćēś ōń ŷōũŕ vēĥĩćĺē ŵĩĺĺ ƀē ƥŕōƥēŕĺŷ ćĺēàńēď àńď ćōńďĩţĩōńēď. Ţĥĩś ŵĩĺĺ ĥēĺƥ ŕēśţōŕē ţĥē śķĩń'ś ńàţũŕàĺ ĝĺōŵ, àś ŵēĺĺ àś ƥŕōţēćţ ĩţ ƒŕōm śţàĩńś àńď ďàmàĝē ƒŕōm ŵàţēŕ àńď śàĺţ ōŕ ōţĥēŕ ďĩŕţ.\",\"detailing-car-wash.list-5.title\":\"ĨŃŢĒŔĨŌŔ ĎĒŢÀĨĹ\",\"detailing-car-wash.list-6.content\":\"Mōśţ àũţōmōţĩvē ŕēţàĩĺēŕś ďō ńōţ ĥàvē ţĥē ēǫũĩƥmēńţ ţō ƥŕōƥēŕĺŷ ćĺēàń, ďēōďōŕĩźē àńď ŵàśĥ ćàŕƥēţ. À ƒũĺĺ ďēţàĩĺ śēŕvĩćē ŕēśţōŕēś ţĥē ćàŕƥēţ, ƒĩŕśţ ŵĩţĥ à ďēēƥ vàćũũm. Ţĥē ćàŕƥēţ ĩś ţĥēń ŵàśĥēď ŵĩţĥ śĥàmƥōō àńď ďēōďōŕĩźēď.\",\"detailing-car-wash.list-6.title\":\"ĆÀŔƤĒŢ ĎĒĒƤ ĆĹĒÀŃĨŃĜ\",\"detailing-car-wash.list.title\":\"Ōũŕ Ƥŕōćēśś\",\"footer.helpLinks.four\":\"Ŵĥàţ ĩś ńēēďēď ƒōŕ ţĥĩś?\",\"footer.helpLinks.one\":\"Ĥōŵ ďōēś ĩţ ŵōŕķ?\",\"footer.helpLinks.three\":\"Ĥōŵ ţō ƥàŷ?\",\"footer.helpLinks.two\":\"Ŵĥēŕē ţō àśķ Ǫũēśţĩōńś?\",\"home-cleaning-couches.carpets.p-1.1\":\"Ţĥē ßĩōĺōĝĩćàĺ Ćàŕƥēţ Ćĺēàńĩńĝ ŵē àƥƥĺŷ ďēśţŕōŷś ĥàŕmƒũĺ mĩćŕō-ōŕĝàńĩśmś śũćĥ àś mĩţēś, ƒũńĝĩ àńď ƀàćţēŕĩà, śō ŷōũ ćàń śţēƥ àńď ţōũćĥ ŵĩţĥōũţ ƒēàŕ ōń à ĥēàĺţĥŷ ćàŕƥēţ!\",\"home-cleaning-couches.carpets.p-1.2\":\"Àţ ţĥē śàmē ţĩmē, ŵē àƥƥĺŷ àĺĺ ţĥē ńēćēśśàŕŷ àćţĩōńś ţō ēĺĩmĩńàţē àńŷ śţàĩńś àńď ďĩŕţ ōń ŷōũŕ ćàŕƥēţ ţō àćĥĩēvē à ńĩćē àēśţĥēţĩć ŕēśũĺţ. Ĩń ōŕďēŕ ţō ƥēŕƒōŕm à Ćōmƥĺēţē Ćàŕƥēţ Ćĺēàńĩńĝ ţĥēŕē àŕē 2 mēţĥōďś ŵē ƒōĺĺōŵ: Ďŕŷ ßĩōĺōĝĩćàĺ Ćàŕƥēţ Ćĺēàńĩńĝ ŵĥĩćĥ ćōńćēŕńś ţĥē ēxţēŕmĩńàţĩōń ōƒ ţĥē mĩćŕōƀĩàĺ ĺōàď & Ŵēţ ßĩōĺōĝĩćàĺ Ćàŕƥēţ Ćĺēàńĩńĝ ŵĥĩćĥ ćōńćēŕńś ţĥē àēśţĥēţĩć ƥàŕţ.\",\"home-cleaning-couches.carpets.p-2.item-1\":\"Ćĺēàńĩńĝ Ĥàńďmàďē Ćàŕƥēţś\",\"home-cleaning-couches.carpets.p-2.item-2\":\"Ćĺēàńĩńĝ Ŵōōĺēń Ćàŕƥēţś\",\"home-cleaning-couches.carpets.p-2.item-3\":\"Ćĺēàńĩńĝ Śŷńţĥēţĩć Ćàŕƥēţś\",\"home-cleaning-couches.carpets.p-2.item-4\":\"Ďŕŷ Ćĺēàńĩńĝ Ćàŕƥēţś\",\"home-cleaning-couches.carpets.p-2.item-5\":\"Ćĺēàńĩńĝ Ćàŕƥēţś ƒŕōm Mĩţēś\",\"home-cleaning-couches.carpets.p-2.item-6\":\"Ćĺēàńĩńĝ Ćàŕƥēţś ƒŕōm Śţàĩńś\",\"home-cleaning-couches.carpets.p-3\":\"Ćōśţ: €10.00 ƥēŕ śǫũàŕē mēţēŕ\",\"home-cleaning-couches.carpets.p2.title\":\"Ćàţēĝōŕĩēś\",\"home-cleaning-couches.carpets.title\":\"Ćàŕƥēţś\",\"home-cleaning-couches.couches.p-1.1\":\"Śōƒàś àńď ĺĩvĩńĝ àŕēàś ũśũàĺĺŷ ŕēćēĩvē ţĥē mōśţ ũśē ōƒ àĺĺ ōţĥēŕ àŕēàś ōƒ ţĥē ĥōũśē. Ţĥē ĺĩvĩńĝ ŕōōm ĩś ćĺēàńēď ŵĩţĥ ĥŷƥōàĺĺēŕĝēńĩć Ķàŕćĥēŕ ƥŕōďũćţś àńď Ķàŕćĥēŕ ŵàśĥĩńĝ-ŕĩńśĩńĝ màćĥĩńēś. Ŷōũŕ ƥŕēćĩōũś ƒũŕńĩţũŕē ćàń ĺōśē ţĥē vĩƀŕàńćŷ ōƒ ĩţś ćōĺōŕś àńď ƀēćōmē à ƀŕēēďĩńĝ ĝŕōũńď ƒōŕ ĝēŕmś. Ēxĥàũśţ ĝàś, śmōķĩńĝ, ďũśţ, ēţć. àŕē ķēŷ ƒàćţōŕś ĩń ţĥĩś ŵēàŕ àńď ţēàŕ.\",\"home-cleaning-couches.couches.p-1.2\":\"Àńď ōƒ ćōũŕśē ţĥē ćàśē (śōƒàś ĩń ţĥē śàmē śƥàćē àś ōũŕ ĺĩţţĺē àńĝēĺś) ĩś mōŕē ōŕ ĺēśś ķńōŵń ţō àĺĺ ōƒ ũś. Màŕķēŕś, ƥàĩńţś, mĩĺķ àńď màńŷ ōţĥēŕś àŕē śţàĩńś ţĥàţ ńēēď ƥŕōƒēśśĩōńàĺ ćàŕē. Ďō ńōţĥĩńĝ ĩń ţĥēśē ćàśēś ēxćēƥţ ćàĺĺ ćĺēàń4ũ. Ŕēmēmƀēŕ ţĥàţ ĩƒ à śţàĩń ĩś ďēśţàƀĩĺĩźēď ƀŷ ŷōũŕ àţţēmƥţ ţō ćĺēàń ĩţ, ĩţ ćàń ƀēćōmē ƥēŕmàńēńţ ōń ŷōũŕ śōƒà.\",\"home-cleaning-couches.couches.p-2.item-1\":\"ßĩō-ćĺēàńĩńĝ ōƒ à ţŵō-śēàţēŕ śōƒà: 60,00 €\",\"home-cleaning-couches.couches.p-2.item-2\":\"ßĩō-ćĺēàńĩńĝ ţĥŕēē-śēàţēŕ śōƒà: €75.00\",\"home-cleaning-couches.couches.p-2.item-3\":\"ßĩō-ćĺēàńĩńĝ ƥēŕ àďďĩţĩōńàĺ śēàţ: €20.00\",\"home-cleaning-couches.couches.p-2.item-4\":\"ßĩō-ćĺēàńĩńĝ ōƒ à ĺēàţĥēŕ śōƒà: €38.00\",\"home-cleaning-couches.couches.p-2.item-5\":\"Àŕmćĥàĩŕ ƀĩō-ćĺēàńĩńĝ: €20.00\",\"home-cleaning-couches.couches.p-2.item-6\":\"ßēŕźēŕà ƀĩō-ćĺēàńĩńĝ: €20.00\",\"home-cleaning-couches.couches.p-2.item-7\":\"Ćĥàĩŕ ƀĩō-ćĺēàńĩńĝ: €12.00\",\"home-cleaning-couches.couches.p-2.item-8\":\"Ćĥàĩŕ ƀĩō-ćĺēàńĩńĝ (ƀàćķ & śēàţ): €18.00\",\"home-cleaning-couches.couches.p-2.title\":\"Ćàţēĝōŕĩēś\",\"home-cleaning-couches.couches.p-3.1\":\"* Àĺĺ ōũŕ ƥŕĩćēś ĩńćĺũďē ţĥē ćĥēmĩćàĺ ćōmƥōũńď ţĥàţ àĩmś ţō ēxţēńď ţĥē ĺĩƒē ōƒ ŷōũŕ ƥŕōďũćţś.\",\"home-cleaning-couches.couches.title\":\"Ćōũćĥēś\",\"home-cleaning-couches.mattresses.p-1.1\":\"À ĥōũśē ďũśţ mĩţē ƥŕōďũćēś àƀōũţ 20 ƥēĺĺēţś ōƒ ƒēćēś ƥēŕ ďàŷ. Ĩƒ ŷōũ ćōńśĩďēŕ ţĥàţ ĩţś ĺĩƒēśƥàń ĩś àƀōũţ 42 ďàŷś, ĩţ mēàńś ţĥàţ ĩţ ƥŕōďũćēś à ţōţàĺ ōƒ 840 ƥĩēćēś ōƒ ţĥēm. Ţĥĩś àmōũńţ ĩś àćţũàĺĺŷ 200 ţĩmēś ĝŕēàţēŕ ţĥàń ţĥē ŵēĩĝĥţ ōƒ ţĥē mĩţē ĩţśēĺƒ (Ďēŕmàţōƥĥàĝōĺďēś ƥţēŕōńŷśśĩńũś). Ēvēń à ćĺēàń ƥĩĺĺōŵ ćōńţàĩńś màńŷ ţēńś ōƒ ţĥōũśàńďś ōƒ \\\"ďōmēśţĩć àńĩmàĺś\\\" ōƒ àƀōũţ 0.3 ţĥōũśàńď. Ĩń ƒàćţ, ŵĥēń ƥĩĺĺōŵś ĥàvē ńōţ ƀēēń ćĺēàńēď ƒōŕ ŷēàŕś (ũśũàĺĺŷ ōńĺŷ ţĥē ćōvēŕ ĩś ŵàśĥēď), ũƥ ţō 400,000 mĩţēś ćàń ĺĩvē ţĥēŕē\",\"home-cleaning-couches.mattresses.p-1.2\":\"Mĩţēś àĺŵàŷś ćàŕŕŷ ŵĩţĥ ţĥēm ţĥēĩŕ ţōōĺ, ŵĥĩćĥ ĥàś Ĵũśţ ţĥàţ ńàmē, ńàmēĺŷ Àśƥēŕĝĩĺĺũś Ŕēƥēńś, ţĥē ƒũńĝũś ŵē mēńţĩōńēď ēàŕĺĩēŕ. Ĩń ţĥĩś ŵàŷ, ţĥē ƒũńĝũś ĩś ďĩśƥēŕśēď ŵĩţĥ ēàćĥ mōvēmēńţ ōƒ ţĥē mĩţē àńď ţĥē śķĩń śćàĺēś ƀēćōmē mōŕē ƥàĺàţàƀĺē ţō ţĥē mĩţēś. Ţĥē ďàńĝēŕ, ĥōŵēvēŕ, ĩś ńōţ ţĥē mĩţē ĩţśēĺƒ, ƀũţ ţĥēĩŕ ďŕōƥƥĩńĝś. Ţĥēśē ďŕōƥƥĩńĝś ćōńţàĩń ĩńĝŕēďĩēńţś ţĥàţ ćàũśē àĺĺēŕĝĩēś. Ţĥàţ ĩś, ŵĥēń ţĥēŷ àŕē ēxĥàĺēď àś ƒĩńē ďũśţ, ţĥēŷ ćàũśē àĺĺēŕĝĩēś, śũćĥ àś ţĥē àĺĺēŕĝŷ ţĥàţ ćōmēś ƒŕōm ĥōũśē ďũśţ. Ŵàńţ ţō ķńōŵ ĥōŵ mũćĥ ƒēćēś à mĩţē ćàń ƥŕōďũćē ƥēŕ ďàŷ?\",\"home-cleaning-couches.mattresses.p-2.item-1\":\"Śĩńĝĺē ĺàŷēŕ ƥŕĩćē: €32.00\",\"home-cleaning-couches.mattresses.p-2.item-2\":\"Ďōũƀĺē ĺàŷēŕ ƥŕĩćē: €60.00\",\"home-cleaning-couches.mattresses.p-2.title\":\"Ćàţēĝōŕĩēś\",\"home-cleaning-couches.mattresses.title\":\"Màţţŕēśśēś\",\"home-cleaning-couches.title\":\"Ĥōmē Ćĺēàńĩńĝ Śēŕvĩćēś\",\"navlinks.contact\":\"Ćōńţàćţ\",\"navlinks.home\":\"Ĥōmē\",\"navlinks.portfolio\":\"Ƥōŕţƒōĺĩō\",\"navlinks.services\":\"Śēŕvĩćēś\",\"property-cleaning-services.p-1.1.content\":\"Àţ Ĝĺōŵ Ķĩńĝ ŵē ũńďēŕţàķē ţō ćĺēàń ŷōũŕ śĩďēŵàĺķ. ßēśĩďē ŷōũ ĩń ēvēŕŷ ńēēď!\",\"property-cleaning-services.p-1.2.content\":\"Ćōśţ: €6.00 ​​ƥēŕ m2\",\"property-cleaning-services.p-1.title\":\"Śĩďēŵàĺķ Ćĺēàńĩńĝ\",\"property-cleaning-services.p-2.1.content\":\"Àţ Ĝĺōŵ Ķĩńĝ ŵē ũńďēŕţàķē ţō ćĺēàń ŷōũŕ ƥĺōţ. ßēśĩďē ŷōũ ĩń ēvēŕŷ ńēēď!\",\"property-cleaning-services.p-2.title\":\"Śēŕvĩćē Àŕēà Ćĺēàńĩńĝ\",\"property-cleaning-services.title\":\"Ƥŕōƥēŕţŷ Ćĺēàńĩńĝ Śēŕvĩćēś\",\"service-sidebar.title\":\"Ōũŕ Śēŕvĩćēś\",\"serviceData.car-sub-category.1\":\"Ćàŕ Ŵàśĥ\",\"serviceData.car-sub-category.2\":\"Ďēţàĩĺĩńĝ\",\"serviceData.car-sub-category.3\":\"Mōţōŕƀĩķē Ŵàśĥ\",\"serviceData.home-sub-category.1\":\"Ćōũćĥēś\",\"serviceData.home-sub-category.2\":\"Ćàŕƥēţś\",\"serviceData.home-sub-category.3\":\"Màţţŕēśśēś\",\"serviceSection.button.text\":\"ßōōķ Ńōŵ\",\"services-side-bar.layout.1\":\"Ćàŕ Ŵàśĥ àńď Ďēţàĩĺĩńĝ\",\"services-side-bar.layout.2\":\"Ĥōmē Ćĺēàńĩńĝ\",\"services-side-bar.layout.3\":\"Ŷàćĥţ Ćĺēàńĩńĝ\",\"services-side-bar.layout.4\":\"Ƥŕōƥēŕţŷ Ćĺēàńĩńĝ\",\"services.book-an-appointment-now\":\"ßŌŌĶ ÀŃ ÀƤƤŌĨŃŢMĒŃŢ ŃŌŴ\",\"services.request-an-offer\":\"ŔĒǪŨĒŚŢ ÀŃ ŌƑƑĒŔ\",\"wizard-form-icons/car-service-extras.10.content\":\"ßĩōĺōĝĩćàĺ ćĺēàńĩńĝ ōƒ à ćĥĩĺď śēàţ.\",\"wizard-form-icons/car-service-extras.10.title\":\"ĆĤĨĹĎ ŚĒÀŢ\",\"wizard-form-icons/car-service-extras.11.content\":\"ßĩōĺōĝĩćàĺ ćĺēàńĩńĝ ōƒ 2 ćĥĩĺďŕēń'ś śēàţś.\",\"wizard-form-icons/car-service-extras.11.title\":\"2 ĆĤĨĹĎŔĒŃ'Ś ŚĒÀŢŚ\",\"wizard-form-icons/car-service-extras.12.content\":\"Ŵàx ŵĩţĥ ÀŨŢŌĜĹŶM ŵàx, ŵĩţĥ à ďũŕàţĩōń ōƒ 2 mōńţĥś, ĝĩvēś àń ēxţŕà ƥŕōţēćţĩōń ţō ţĥē śũŕƒàćē ōƒ ŷōũŕ ćàŕ.\",\"wizard-form-icons/car-service-extras.12.title\":\"ƤŔĒMĨŨM ÀŨŢŌĜĹŶM ŴÀX\",\"wizard-form-icons/car-service-extras.2.content\":\"Ōďōŕś àŕē ńōţ ćōvēŕēď ƀũţ ńēũţŕàĺĩźēď. Ƒōŕ ōďōŕś śũćĥ àś Ćĩĝàŕēţţēś, Àńĩmàĺś àńď ōţĥēŕ ƥēŕśĩśţēńţ ōďōŕś.\",\"wizard-form-icons/car-service-extras.2.title\":\"ŔĒMŌVĨŃĜ ŌĎŌŔŚ + MĨĆŔŌßĒŚ\",\"wizard-form-icons/car-service-extras.3.content\":\"Ĥàńď ƥōĺĩśĥĩńĝ, ŕēmōvàĺ ōƒ ďēƥōśĩţś ŵĩţĥ ƥĺàśţĩćĩńē àńď ĆĒŔÀMĨĆ ćēŕàmĩć ćōàţĩńĝ. Ĩţ ōƒƒēŕś à śũƥēŕ ĥŷďŕōƥĥōƀĩć ƥŕōţēćţĩōń àńď àń àmàźĩńĝ ƥōĺĩśĥ & ƒĩńĩśĥ, ĩţ ĺàśţś ƒōŕ 3 mōńţĥś.\",\"wizard-form-icons/car-service-extras.3.price\":\"Ŕēǫũēśţ à Ǫũōţē\",\"wizard-form-icons/car-service-extras.3.title\":\"ƤŌĹĨŚĤĨŃĜ – ĆĒŔÀMĨĆ ĆŌÀŢĨŃĜ\",\"wizard-form-icons/car-service-extras.4.content\":\"Śƥēćĩàĺ ĝĺàśś ćōàţĩńĝ ţĥàţ ōƒƒēŕś ēxţēŕńàĺ ĥŷďŕōƥĥōƀĩć àńď ĩńţēŕńàĺ àńţĩ-ƒōĝ ƥŕōţēćţĩōń, ĩďēàĺ ƒōŕ ţĥē ŵĩńţēŕ mōńţĥś.\",\"wizard-form-icons/car-service-extras.4.title\":\"ĤŶĎŔŌƤĤŌßĨĆ & ÀŃŢĨ-ƑŌĜ ĜĹÀŚŚ ĆŌÀŢĨŃĜ\",\"wizard-form-icons/car-service-extras.5.content\":\"Ţĩŕē ƥŕēśśũŕē ćĥēćķ & ĩńƒĺàţĩōń.\",\"wizard-form-icons/car-service-extras.5.price\":\"ƑŔĒĒ\",\"wizard-form-icons/car-service-extras.5.title\":\"ŢĨŔĒ ĨŃƑĹÀŢĨŌŃ\",\"wizard-form-icons/car-service-extras.6.content\":\"Ŕēƒĩĺĺĩńĝ ōƒ ćĺēàńĩńĝ ĺĩǫũĩď śōàƥ ƒōŕ ţĥē ŵĩńďśĥĩēĺď ŵĩƥēŕś.\",\"wizard-form-icons/car-service-extras.6.title\":\"ĹĨǪŨĨĎ ŚŌÀƤ ƑŌŔ ŴĨŃĎŚĤĨĒĹĎ ŴĨƤĒŔŚ\",\"wizard-form-icons/car-service-extras.7.content\":\"Ĥōōď ćĺēàńĩńĝ, màĩńţēńàńćē àńď ŵàţēŕƥŕōōƒĩńĝ ƒōŕ à ćōńvēŕţĩƀĺē ćàŕ.\",\"wizard-form-icons/car-service-extras.7.title\":\"ĤŌŌĎ ŴÀŢĒŔƤŔŌŌƑĨŃĜ & MÀĨŃŢĒŃÀŃĆĒ\",\"wizard-form-icons/car-service-extras.8.content\":\"Ŵē ćĺēàń ŷōũŕ àĩŕ ćōńďĩţĩōń ũńĩţ\",\"wizard-form-icons/car-service-extras.8.title\":\"ĆĹĒÀŃĨŃĜ ÀĨŔ ĆŌŃĎĨŢĨŌŃĒŔ\",\"wizard-form-icons/car-service-extras.9.content\":\"Ŕēmōvĩńĝ vēŕŷ ƒĩńē ƥēţ ĥàĩŕ ƒŕōm śēàţś àńď ćàŕƥēţĩńĝ.\",\"wizard-form-icons/car-service-extras.9.title\":\"ƤĒŢ ĤÀĨŔ ŔĒMŌVÀĹ\",\"yacht-cleaning-boat.p-1.1\":\"Ţĥē ćĺēàńĩńĝ ĩś ďōńē ŵĩţĥōũţ ţĥē ũśē ōƒ à ƀŕũśĥ ōŕ śƥōńĝē ƀũţ ōńĺŷ ŵĩţĥ ţĥē ũśē ōƒ ĥōţ ŵàţēŕ ƒōŕ ĺēśś ďàmàĝē ţō ţĥē ćàŕ'ś ēxţēŕĩōŕ ƥàĩńţ.\",\"yacht-cleaning-boat.p-1.2\":\"Àţ Ĝĺōŵ Ķĩńĝ ŵē ōƒƒēŕ ŷōũ à ćōmƥĺēţē ćĺēàńĩńĝ ŵĩţĥ ƥŕē-ŵàśĥĩńĝ àńď màĩńĺŷ ŵàśĥĩńĝ ţĥē màćĥĩńē ŵĩţĥ àćţĩvē ƒōàm, ćĺēàńĩńĝ ţĥē ƒōĝ ĺĩĝĥţś àńď ŕĩmś, ŕēmōvĩńĝ ĩńśēćţś, ƥŕōţēćţĩvē ŵàx àńď ŕĩńśĩńĝ ţĥē ćàŕ ŵĩţĥ ďēĩōńĩźēď ŵàţēŕ!\",\"yacht-cleaning-boat.p-1.3\":\"Ŷōũŕ màćĥĩńē ĩś ţĥēń ţĥōŕōũĝĥĺŷ ŵĩƥēď.\",\"yacht-cleaning-boat.p-1.4\":\"Ĩń ćĺēàńĩńĝ, ŵĩţĥ ŕēśƥēćţ ƒōŕ ƥēōƥĺē àńď ţĥē ēńvĩŕōńmēńţ àś ōũŕ ĝũĩďĩńĝ ƥŕĩńćĩƥĺē, ŵē ũśē ēćōĺōĝĩćàĺĺŷ ƀĩōďēĝŕàďàƀĺē ƥŕōďũćţś.\",\"yacht-cleaning-boat.p-1.5\":\"Ŵē ƀĺōŵ ţĥē ĩńśĩďē ōƒ ŷōũŕ màćĥĩńē ţō ŕēmōvē ţĥē ďũśţ àńď ţĥēń ćĺēàń ŵĩţĥ à vàćũũm ćĺēàńēŕ. Ƒĩńàĺĺŷ, ŵē ƥŕōćēēď ŵĩţĥ ćĺēàńĩńĝ àńď màĩńţēńàńćē ōƒ àĺĺ ƥĺàśţĩć śũŕƒàćēś, ďŕŷ ćĺēàńĩńĝ àńď ƥēŕƒũmĩńĝ ţĥē śàďďĺē ōƒ ŷōũŕ màćĥĩńē.\",\"yacht-cleaning-boat.p-1.6\":\"Mĩńĩmũm ƒēē ţō ćōmē ţō ŷōũŕ ƥĺàćē: €30.00\",\"yacht-cleaning-boat.p-2.desc\":\"Ŵē ũńďēŕţàķē ţĥē ƀĩōĺōĝĩćàĺ ćĺēàńĩńĝ ōƒ ŷōũŕ ƀōàţ, śƥēćĩƒĩćàĺĺŷ:\",\"yacht-cleaning-boat.p-2.item-1\":\"Ćĺēàńĩńĝ màţēŕĩàĺś àńď ƥŕōƒēśśĩōńàĺ ēǫũĩƥmēńţ mēēţ àĺĺ mōďēŕń śţàńďàŕďś.\",\"yacht-cleaning-boat.p-2.item-2\":\"Ćàŕƥēţś\",\"yacht-cleaning-boat.p-2.item-3\":\"Ĺōũńĝēś\",\"yacht-cleaning-boat.p-2.item-4\":\"Màţţŕēśśēś\",\"yacht-cleaning-boat.p-2.title\":\"ßĩōĺōĝĩćàĺ ßōàţ Ćĺēàńĩńĝ\",\"yacht-cleaning-boat.p-3.1\":\"Ōũŕ ćōmƥàńŷ ĥàś ƀēēń ōƒƒēŕĩńĝ ćĺēàńĩńĝ śēŕvĩćēś śĩńćē 1994 ţō ƥŕōƒēśśĩōńàĺ àńď ƥŕĩvàţē ƀōàţś, mōţōŕ & śàĩĺĩńĝ ŷàćĥţś / ƥōŵēŕ ƀōàţś / ĩńƒĺàţàƀĺēś, ķńōŵĩńĝ vēŕŷ ŵēĺĺ ţĥē ŕēǫũĩŕēmēńţś ōƒ à ƀōàţ, ţĥē màţēŕĩàĺś ţō ƀē ũśēď ƒōŕ ēàćĥ śũŕƒàćē àńď ţĥē àţţēńţĩōń ţō ƀē ƥàĩď ţō ţŕàńśƥōŕţàţĩōń ōƒ màćĥĩńēŕŷ.\",\"yacht-cleaning-boat.p-3.2\":\"Śēŕvĩćēś ŵē ōƒƒēŕ àŕē ţĥē ƒōĺĺōŵĩńĝ:\",\"yacht-cleaning-boat.p-3.item-1\":\"Ĩńţēŕńàĺ ćĺēàńĩńĝ\",\"yacht-cleaning-boat.p-3.item-2\":\"Ĩńţēŕńàĺ ƀĩōĺōĝĩćàĺ ŵĩţĥ śţēàm\",\"yacht-cleaning-boat.p-3.item-3\":\"Ēxţēŕńàĺ Ćĺēàńĩńĝ\",\"yacht-cleaning-boat.p-3.item-4\":\"Ēxţēŕĩōŕ Ćĺēàńĩńĝ ďēţàĺĩńĝ*\",\"yacht-cleaning-boat.p-3.item-5\":\"ßĩōĺōĝĩćàĺ ćĺēàńĩńĝ ōƒ ƒàƀŕĩćś / màţţŕēśśēś & ćàŕƥēţś\",\"yacht-cleaning-boat.p-3.item-6\":\"Ŵàśĥĩńĝ ćàŕƥēţś ŵĩţĥ ŕōţàŕŷ màćĥĩńē & ēxţŕàćţĩōń\",\"yacht-cleaning-boat.p-3.item-7\":\"Ćĺōţĥĩńĝ ĺàũńďŕŷ\",\"yacht-cleaning-boat.p-3.item-8\":\"Śţàĩńĺēśś śţēēĺ ƥōĺĩśĥĩńĝ\",\"yacht-cleaning-boat.p-3.item-9\":\"Ţēńďēŕ ćĺēàńĩńĝś\",\"yacht-cleaning-boat.p-3.title\":\"ßĩōĺōĝĩćàĺ ßōàţ Ćĺēàńĩńĝ\",\"yacht-cleaning-boat.title\":\"Ŷàţćĥ Ćĺēàńĩńĝ\"}")};